(2, 1, 'ডিআইজি', 'sadf', '<p>\r\n                        ডিআইজি</p>\r\nডিআইজি অফিস, রাজশাহী\r\n    <p class=\"mobile\"><span>মোবাইল :</span> ০১৩২০-১২২২০০</p>\r\n    <p class=\"phone\"><span>ফোন (অফিস) :</span> ০১৩২০-১২২২০০</p>\r\n    <p class=\"email\"><span>ইমেইল :</span> <a href=\"mailto:digrajshahi@police.gov.bd\" title=\"digrajshahi@police.gov.bd\">digrajshahi@police.gov.bd</a></p>\r\n    <p class=\"fax\"><span>ফ্যাক্স :</span> ০৭২১৭৭৫৪৪৪</p>\r\n    <p class=\"batch\"><span>ব্যাচ (বিসিএস) :</span> ১৭</p>\r\n    <span>বর্তমান কর্মস্থলে যোগদানের তারিখ : </span>১৪ - ০৯ - ২০২০', 'pages/February2021/ESjyw4xfyYFz3Bjond0w.jpg', 'ডিআইজি', 'N/A', 'N/A', 'ACTIVE', '2020-01-03 14:42:06', '2021-02-23 19:30:41', 'জনাব মোঃ আব্দুল বাতেন', 'বিপিএম, পিপিএম'),
(3, 1, 'পুলিশ সুপার', 'n/a', 'পুলিশ সুপার<p class=\"designation\"><span>নওগাঁ </span></p>\r\n      <p class=\"mobile\"><span>মোবাইল :</span> ৮৮০১৩২০১২৩৫০০ </p>\r\n    <p class=\"phone\"><span>ফোন (অফিস) :</span> ০৭৪১-৬২৪২০</p>\r\n    <p class=\"email\"><span>ইমেইল :</span> <a href=\"mailto:spnaogaon@police.gov.bd\" title=\"spnaogaon@police.gov.bd\">spnaogaon@police.gov.bd</a></p>\r\n    <p class=\"fax\"><span>ফ্যাক্স :</span>০৭৪১-৬২৪৯৭</p>\r\n    <p class=\"batch\"><span>ব্যাচ (বিসিএস) :</span> ২২</p>\r\n    <span>বর্তমান কর্মস্থলে যোগদানের তারিখ : 09-09-2019</span>', 'pages/February2021/zZ0Ius4IQB1BqPQySTEk.png', 'পুলিশ সুপার', 'N/A', 'N/A', 'ACTIVE', '2020-01-03 15:46:23', '2021-03-23 01:11:31', 'প্রকৌশলী জনাব আবদুল মান্নান মিয়া', 'বিপিএম'),
