(28, 1, 'ভৌগলিক পরিচিতি', NULL, '<p align=\"center\"><span style=\"font-size: 20px;\"><strong>ভৌগলিক প্রোফাইল:&nbsp; ভৌগলিক পরিচয়ঃ</strong></span></p><p align=\"center\">&nbsp;</p><p>বাংলাদেশের\r\n উত্তর-পশ্চিম ভাগে, বাংলাদেশ-ভারত আমত্মর্জাতিক সীমারেখা সংলগ্ন যে \r\nভূখন্ডটি ১৯৮৪-র পহেলা মার্চের পূর্ব পর্যমত নওগাঁ মহকুমা হিসেবে গণ্য হত, \r\nতাই হয়েছে এখন বাংলাদেশের কণ্ঠশোভা নওগাঁ জেলা।</p><p>উত্তরে ভারতের \r\nদক্ষিণ দিনাজপুর, দক্ষিণে বাংলাদেশের নাটোর ও রাজশাহী, পূর্বে জয়পুরহাট ও \r\nবগুড়া জেলা এবং পশ্চিমে ভারতের মালদহ ও বাংলাদেশের নবাবগঞ্জ জেলা, এরই \r\nঅন্তর্বর্তি ভূ-ভাগ এই নওগাঁ জেলা। এ জেলার আয়তন&nbsp;<span style=\"background-color: rgb(249, 249, 249); font-family: \'Siyam Rupali\', Helvetica, Arial, sans-serif; line-height: 19.03333282470703px; white-space: nowrap;\">৩,৪৩৫.৬৭&nbsp;বর্গ কিমি। জনসংখ্যার ঘনত্ব ৭৫৭ জন/কিমি (বাংলাদেশ পরিসংখ্যান ব্যুরো, ২০১১)।&nbsp;</span>পত্নীতলা,\r\n ধামইরহাট, মহাদেবপুর, পোরশা, সাপাহার, বদলগাছী, মান্দা, নিয়ামতপুর, \r\nআত্রাই, রাণীনগর ও নওগাঁ এই এগারোটি উপজেলা নিয়ে গঠিত নওগাঁ জেলাকে ভূমির \r\nপ্রকৃতি ও বৈশিষ্ট্য অনুসারে তিন ভাগে ভাগ করা যায়। ক) বরেন্দ্র অঞ্চল, খ)\r\n বিল বা ভর অঞ্চল এবং গ) পলি অঞ্চল।</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>(ক) বরেন্দ্র অঞ্চল :</strong></p><p>বলা\r\n হয়, ইন্দ্রের বরে পূণ্যভূমি-উত্তরবঙ্গের বরেন্দ্রভূমি। বরেন্দ্রভূমির \r\nইতিহাস-প্রসিদ্ধি সুবিদিত। উত্তর বাংলায় প্রাপ্ত পঞ্চম ও ষষ্ট শতাব্দীর \r\nগুপ্ত সম্রাটদের রাজত্বকালীন অনেকগুলো তাম্রশাসনে এই অঞ্চলকে পুন্ড্রবর্ধন \r\nনামক ‘ভূক্তি’ বা প্রদেশ বলে উল্লেখ করা হয়েছে। সন্ধ্যাকর নন্দীর রামচরিত \r\nরচিত হবার কালে উত্তর বাংলার বরেন্দ্র বা বারেন্দ্রী নাম সুপ্রতিষ্ঠিত হতে \r\nথাকে। শরত কুমার রায় বলেন, বরেন্দ্রভূমির পূর্ব সীমায় করতোয়া নদী ও \r\nপশ্চিম সীমায় মহানন্দা নদী প্রবাহিতা ছিল।</p><p>প্রাচীন বাংলার ইতিহাস ও \r\nসংস্কৃতিতে এই বরেন্দ্র অঞ্চলের অসামান্য অবদান রয়েছে। সন্দেহ নেই, ভূমির \r\nবিশেষ গঠন বৈশিষ্টই তৎকালে এই অঞ্চলকে বিশেষ গৌরবময় ভূমিকা গ্রহণে \r\nআনুকূল্য প্রদাণ করেছিল ।</p><p>মধ্যযুগের মুসলমান ঐতিহাসিকগণ সংস্কৃত \r\nবরেন্দ্র বা বরেন্দ্রীকে বলতেন বরিন্দ। স্থানীয় ভাষায় এই ‘বরিন্দ’ এলাকা \r\nখিয়ার নামে সমধিক পরিচিত। ‘খিয়ার’ শব্দের অর্থ ক্ষীরাভ অর্থাৎ ক্ষীরের \r\nআভার ন্যায়। খিয়ারে বহুল পরিমাণে চাউল জন্মে এবং তথায় বহুদূর বিস্তৃত \r\nবৃক্ষলতাহীন বিশাল প্রামত্মর, লালবর্ণের মৃত্তিকা ও অনেক সুবৃহৎ অপরিষ্কার \r\nজলাশয় দেখা যায়-অবনীচন্দ্র চট্টোপাধ্যায় ।</p><p style=\"text-align: center;\"><img src=\"https://www.dcnaogaon.gov.bd/images/stories/barendra%20vomi.jpg\" alt=\"barendra%20vomi\" width=\"540\" height=\"254\" border=\"0\"></p><p>&nbsp;</p><p>&nbsp;</p><p>নাটোর\r\n জেলার সিংড়া থেকে আরম্ভ করে রাজশাহী জেলার গোদাগাড়ী-তানোর অঞ্চল, \r\nনবাবগঞ্জ জেলার নাচোল-গোমসত্মাপুর, ভারতের মালদহ জেলার অংশ বিশেষ, নওগাঁ \r\nজেলার পোরশা, সাপাহার, নিয়ামতমপুর, মহাদেবপুর, মান্দা থানার অংশ বিশেষ, \r\nপত্নীতলা ও ধামইরহাট, তারপর বগুড়া ও জয়পুরহাট জেলার পশ্চিমভাগ, গাইবান্ধা\r\n জেলার দক্ষিণ-পশ্চিমাংম দিনাজপুর (অবিভক্ত) জেলার বিস্তৃত দক্ষিণ ভাগ \r\nপর্যমত্ম বঙ্কিমভাবে প্রসারিত বরেন্দ্রভূমি নিখিল বঙ্গের দ্বিতীয় পুরাভূমি\r\n অঞ্চলের অমত্মর্গত।</p><p>লক্ষ্য করলে দেখা যাবে, এগারোটি উপজেলার মধ্যে \r\nসাতটি উপজেলা নিয়ে নওগাঁ জেলা ঐ পুরাভূমি অঞ্চলের প্রায় কেন্দ্রভাগে \r\nঅবস্থিত। এই অবস্থান নওগাঁ জেলার উলিস্নখিত উপজেলা সমূহের ভূমির গঠন \r\nপ্রকৃতিতে স্বতন্ত্র বৈশিষ্ট্য আরোপ করেছে। সামগ্রিকভাবে বাংলাদেশের সমভূমি\r\n অঞ্চলে অবস্থিতি সত্ত্বেও এখানে ভূমি যথেষ্ট উঁচু নীচু, ঢেউ খেলানো, \r\nদক্ষিণ-পূর্ব দিক হতে উত্তর-পশ্চিম দিকে, উচ্চতর হরিদ্রাভ মাটি ক্রমশ লাল \r\nকঙ্করময়, বর্ষাকালে পিচ্ছিল ও অাঁঠাল, কর্দম সৃষ্টিকারী এবং খরাকালে \r\nঅত্যমত্ম রূক্ষ্ম ও শক্ত। এই সমসত্ম অঞ্চলে বিশেষ করে নিয়ামতপুর, পোরশা, \r\nসাপাহার এলাকায় ভূগর্ভস্থ পানির গভীরতা সাধারণের চাইতে অনেক বেশি। কোথাও \r\nকোথাও এত বেশি যে শক্ত মাটি ভেদ করে গভীর বা অগভীর নলকূপ বসানো বেশ \r\nকষ্টসাধ্য। উদাহরণ হিসেবে এখানে নিয়ামতপুর উপজেলার রসুলপুর ইউনিয়নের \r\nঅমত্মর্গত গাঙ্গোর গ্রামের একটি ইদারার উলেস্নখ করা যায়। ইদারাটির গভীরতা \r\n১২০ (একশ কুড়ি) ফুট ।</p><p>&nbsp;</p><p><strong>(খ) বিল বা ভর অঞ্চল :</strong></p><p>&nbsp;</p><p>মহাদেবপুর\r\n থানার পূর্ব ও পশিচমাঞ্চল সাপাহার ও পোরশার উত্তর পশ্চিমাঞ্চল তথা জবই ও \r\nরোকনপুরের বিল, মহাদেবপুর থানার পশ্চিমাবর্তী ছাতরার বিল, বিল ঠাকুরমান্দা ও\r\n উথরাইলসহ মান্দা থানার দক্ষিণ-পশ্চিম অঞ্চল এবং বিল রক্তদহসহ রাণীনগরের \r\nউত্তর-পূর্ব ভাগের কিছু অংশ এবং আত্রাই থানার পূর্ব-দক্ষিণ অঞ্চলের \r\nনিম্নাংশ নিয়ে নওগাঁ জেলার বিল অঞ্চল গঠিত। বর্ষাকালসহ বছরের ৪ থেকে ৬ মাস\r\n এসব এলাকা জলমগ্ন থাকে। গ্রামগুলো দেখায় বিচ্ছিন্ন দ্বীপের মতো। শুকনা \r\nমৌসুমে শক্ত ও রূক্ষ্ম মাটি দেখা যায় ।</p><p><strong>(গ) পলি অঞ্চল :</strong></p><p>ছোট\r\n যমুনা তীরবর্তী আত্রাই থানার পূর্ব তীরবর্তী রসুলপুর, মির্জাপুর, রাণীনগর \r\nথানার ঘোষগ্রাম, বেতগাড়ি থেকে কুজাইল, ত্রিমোহনী, নওগাঁ থানার চন্ডিপুর, \r\nবোয়ালিয়া, আদমদুর্গাপুর ও পশ্চিম তীরবর্তী শৈলগাছী, মকিমপুরসহ নওগাঁ পৌর \r\nএলাকা এবং নওগাঁ থেকে বদলগাছী থানা এলাকা পর্যমত্ম বক্তারপুর, কীর্তিপুর, \r\nবালুভরা প্রভৃতি দুই তীরবর্তী অঞ্চল এবং ধামইরহাট, পত্নীতলা, মহাদেবপুর \r\nথানার আত্রাই তীরবর্তী কিছু অঞ্চল নিয়ে মোটামোটিভাবে নওগাঁ জেলার পলি \r\nঅঞ্চল গঠিত। এইসব এলাকার মাটি দোআঁশ এবং খুবই উর্বর। বছরে তিনটি ফসল ফলে। \r\nনওগাঁর পলি অঞ্চল থেকে তরিতরকারি ১৯৪৭ এর পূর্বে কলকাতায় চালান যেত। এই \r\nএলাকা ঘনবসতিপূর্ণ।</p><p><strong>জলবায়ুঃ</strong></p><p>বৃষ্টিপাত ও \r\nভূমির গঠন প্রকৃতিগত তারতম্য অনুসারে বাংলাদেশের অপরাপর অঞ্চলের সঙ্গে \r\nনওগাঁ জেলার আবহাওয়ার পার্থক্য সুক্ষ্ম হলেও অলক্ষণীয় নয়। জেলার \r\nঅভ্যমত্মরেও ভর এবং বরিন্দ অঞ্চলের মধ্যে আবহাওয়ার কিছুটা তারতম্য \r\nপরিলক্ষিত হয়।</p><p>ক্রামত্মীয় আর্দ্র কৃষি ভূমির অমত্মর্গত বাংলাদেশের \r\nসর্বত্র ভারত মহাসাগর থেকে প্রবাহিত দক্ষিণ-পশ্চিমী মৌসুমী বায়ু প্রচুর \r\nবৃষ্টিপাত ঘটালেও নওগাঁর ব্যাপারে তার কৃপণতা খুব। কেননা সিলেট, চট্টগ্রাম,\r\n নোয়াখালীর মতো অঞ্চলসমূহে বৃষ্টিপাতের বার্ষিক গড় যেখানে ১০০(একশ)ইঞ্চির\r\n ঊর্ধ্বে, সেখানে নওগাঁ জেলায় তার পরিমাণ ৪০(চল্লিশ) ৬০(ষাট) ইঞ্চির মধ্যে\r\n মাত্র। তার বেশি বৃষ্টি যে কখনোই হয়না তা নয়, তবে সেটা ব্যতিক্রম। অঞ্চল\r\n ভেদে আবার এই বৃষ্টিপাতেরও তারতম্য আছে। যেমন জেলার নীতপুর, সাপাহারে \r\nবৃষ্টি হয় সবচেয়ে কম এবং রাণীনগর, আত্রাই,নওগাঁয় সবচেয়ে বেশি। ফলে \r\nবরিন্দ অঞ্চলে অনাবৃষ্টি প্রধান সমস্যা, আর ভর অঞ্চলে প্রধান সমস্যা বন্যা।\r\n বন্যা অবশ্য সেখানে নিম্নভূমির কারণেই বেশি হয়। ভূমির গঠন ও বৃষ্টিপাতের \r\nতারতম্য অনুসারে খরা মৌসুমে নওগাঁ জেলার উত্তর-পশ্চিমাঞ্চলে মাটি যেমন \r\nরূক্ষ্ম, শীতের দাপটও তেমনি তীব্র। মাঘ মাসের হু হু হিমেল বাতাসে মানুষের \r\nচামড়ায় টান ধরে, কারোওবা ঠোঁট এবং পায়ের গোড়ালী ও তালু ফেটে রক্ত ঝরে। \r\nচৈত্রের খাঁ খাঁ প্রামতর গ্রীষ্মকালে যেন আগুনের হলকা ছড়ায়, পক্ষামত্মরে \r\nবিল বা ভর অঞ্চলের মাটি প্রায় সারা বছরই স্যাঁতসেতে এবং সেই কারণে কিছুটা \r\nঅস্বাস্থ্যকরও বটে।</p><p>শীত ও গ্রীষ্মে এই জেলার তাপমাত্রায় যথেষ্ট \r\nহ্রাসবৃদ্ধি ঘটে। ১৯৮৪র ডিসেমবরের শেষভাগে নওগাঁ শহরের তাপমাত্রা যেখানে \r\n৪৪.৬ ডিগ্রী ফারেনহাইটে নেমে আসে সেখানে ১৯৮৫র ১৬ এপ্রিল দিবাভাগে তা ১১১.২\r\n ডিগ্রী ফারেনহাইটে উঠে যায়। কোন কোন বছর শীতকালীন তাপমাত্রা ৪৩ ডিগ্রী \r\nফারেনহাইটে নেমে আসে এবং গ্রীষ্মের তাপমাত্রাও ততোধিক বৃদ্ধি পায়। অবশ্য \r\nগ্রীষ্মের দিবাভাগের তুলনায় সচরাচর রাত্রির তাপমাত্রা কিছুটা কম হয়।</p><p>সাধারণভাবে\r\n বলতে গেলে নওগাঁর আবহাওয়া নাতিশীতোষ্ণ এবং বেশ ভদ্রও। দক্ষিণ বিভাগ বা \r\nপূর্ববঙ্গের মত ফিবছর এখানে ঝড় বাদলের তান্ডব নেই। তবে শীতকালে ঘন \r\nকুয়াশায় এবং চৈত্র বৈশাখে ধূলি ঝড়ে মাঝে মাঝে চারিদিক সমাচ্ছন্ন হয়ে \r\nযায়।</p><p><strong>নদ নদী :</strong></p><p>নওগাঁ জেলার মধ্য দিয়ে বেশ \r\nকয়েকটি নদ-নদী প্রবাহিত। সব কটির উৎসমূলে রয়েছে হিমালয়ের সিকিম অঞ্চল \r\nহতে নেমে আসা তিস্তা নদী। ‘তিস্তা বা ত্রি-স্রোতা উত্তরবঙ্গের গুরুত্বপূর্ণ\r\n নদী। হিমালয়ে তার জন্ম। বাংলাদেশে প্রবেশ করেছে দার্জিলিং, জলপাইগুড়ির \r\nভিতর দিয়ে। জলপাইগুড়ি থেকে তিস্তা তিনভাগে ভাগ হয়ে সোজা দক্ষিণে \r\nপ্রবাহিত হয়েছে। দক্ষিণবাহী পূর্বতম প্রবাহের নাম করতোয়া, দক্ষিণবাহী \r\nপশ্চিমতম ধারার নাম পুনর্ভবা বা পূর্ণভবা। মধ্যবর্তী ধারার নাম আত্রাই।’ \r\n(অজয় রায় বাঙলা ও বাঙালী, পৃঃ ১০)</p><p>নওগাঁ জেলার (এবং বাংলাদেশেরও) \r\nপশ্চিম সীমামত দিয়ে প্রবাহিত পূনর্ভবা, মধ্যবর্তী আত্রাই এবং পূর্বভাগে \r\nযমুনা এই জেলার প্রধান নদী। যমুনাও মূলত তিস্তা নদীরই একটি শাখা।</p><p><strong>(ক) আত্রাই :</strong>&nbsp;এই\r\n নদী পশ্চিম দিনাজপুরের বালুরঘাট হয়ে ধামইরহাট উপজেলার শিমুলতলীতে নওগাঁ \r\nজেলায় প্রবেশ করেছে এবং দক্ষিণে গিয়ে পত্নীতলা, মহাদেবপুর ও মান্দা \r\nউপজেলা কেনদ্র স্পর্শ করেছে; তারপর মান্দার নূরুলস্নাবাদ হাইস্কুলের নিকট \r\nথেকে দক্ষিণ-পূর্বগামী হয়ে আত্রাই থানার রসুলপুরে-উত্তর থেকে আগত যমুনার \r\nপ্রবাহ নিয়ে আত্রাই (আহসানগঞ্জ) রেল স্টেশনও উপজেলা কেন্দ্র ঘেঁষে জেলার \r\nদক্ষিণ-পূর্ব কোণে তেমুখ নামক স্থানে বিভক্ত হয়ে নাটোর জেলা সীমানায় \r\nপ্রবেশ করেছে।&nbsp;</p><p>&nbsp;</p><p style=\"text-align: center;\"><img src=\"https://www.dcnaogaon.gov.bd/images/stories/11022010.jpg\" alt=\"11022010\" width=\"598\" height=\"259\" border=\"0\"></p><p>&nbsp;</p><p style=\"text-align: center;\">চিত্র সংগ্রহ ও সংযোজন: ড. মোজাফফর আহমেদ, অতিরিক্ত জেলা প্রশাসক (রাজস্ব), নওগাঁ।&nbsp;তারিখ:&nbsp;০২রা জানুয়ারী২০১০</p><p>&nbsp;</p><p>এখানেই\r\n সে উত্তরে বগুড়া হয়ে নওগাঁ জেলার রবীন্দ্রস্মৃতি বিজড়িত পতিসরের উপর \r\nদিয়ে প্রবাহিত নাগর নদের ধারা গ্রহণ করেছে। পরে চলনবিল পেরিয়ে আত্রাই ও \r\nকরতোয়ার মিলিত স্রোত পদ্মার প্রবাহে মিশ্রিত হয়েছে। নওগাঁ জেলার মাঝ \r\nদিয়ে বঙ্কিমভাবে সবচেয়ে বেশি পথ পাড়ি দিয়ে আত্রাই এই জেলার দীর্ঘতম নদী\r\n হবার গৌরব অর্জন করেছে। তুলনামূলকভাবে এর নাব্যতাও বেশি।</p><p><strong>(খ) পুনর্ভবা :</strong>&nbsp;বাংলাদেশের\r\n দিনাজপুর ও ভারতের পশ্চিম দিনাজপুর জেলা পাড়ি দিয়ে এসে এই নদী নওগাঁ \r\nজেলার উত্তর-পশ্চিম কোণে পাতাড়ি গ্রাশের সামান্য উত্তরে সাপাহার থানায় \r\nপ্রবেশ করেছে এবং সেখান থেকে দক্ষিণে আলাদিপুর গ্রামের নিকট সাপাহার \r\nঅতিক্রম করে পোরশার সীমায় উপনীত হয়েছে। অতঃপর মাইল তিন দক্ষিণে নীতপুরে \r\nএবং নীতপুর থেকে আরো মাইল পাঁচেক দক্ষিণে রোকনপুরের বিলের মধ্যে গিয়ে \r\nপুনর্ভবা নবাবগঞ্জ জেলায় প্রবেশ করেছে। রোহনপুরে পুনর্ভবা মহানন্দার ও \r\nরাজশাহীর গোদাগাড়ির নিকট মহানন্দা পদ্মার সঙ্গে মিলিত হয়েছে।</p><p>কলমুডাঙ্গা\r\n পেরিয়ে পূর্বদিকে সামান্য বাঁক নিয়ে বাংলাদেশের অনেকটা অভ্যমত্মরে \r\nপ্রবেশ করলেও পাতাড়ি থেকে রোকনপুরের বিল পর্যমত্ম নওগাঁ জেলার অভ্যমত্মরে \r\nপ্রায় সর্বত্র পুনর্ভবা বাংলাদেশ-ভারত আমত্মর্জাতিক সীমা রেখার পূর্বধার \r\nঘেঁষে প্রবাহিত।</p><p><strong>(গ) ছোট যমুনা :</strong>&nbsp;ভারতের জলপাইগুড়ি\r\n থেকে বাংলাদেশের দিনাজপুর হয়ে ভারতের দক্ষিণ দিনাজপুরের হিলি স্পর্শ করে \r\nএই নদী জয়পুরহাট জেলা অতিক্রম করেছে এবং ধামইরহাট উপজেলার ইসবপুর \r\nইউনিয়নের পোড়ানগরে নওগাঁ জেলায় প্রবেশ করেছে। ইসবপুর পালপাড়ার নিকট এসে\r\n যমুনা চকইলাম ও সলপী হয়ে আগত ‘শ্রী’ বা চিরি নদীর প্রবাহ গ্রহণ করেছে। \r\nপরে ক্রমশ দক্ষিণবাহী হয়ে পত্নীতলা থানার পূর্বপ্রামত্মবর্তী ত্রিমোহনীতে \r\nঘুকশীর প্রবাহ নিয়ে বদলগাছি থানা কেন্দ্রের পূর্বকোল ঘেঁষে নওগাঁর নওগাঁর \r\nনিকটবর্তী মোক্তার পাড়ায় এসে একটি কাটা খালের মাধ্যমে তুলসীগঙ্গার প্রবাহ\r\n গ্রহণ করেছে। অতঃপর নওগাঁ শহরের ভেতর দিয়ে প্রবাহিত হয়ে আরো দক্ষিণে \r\nনওগাঁ ও রাণীনগর থানা অতিক্রম করে সে আত্রাইয়ের প্রবাহের সঙ্গে মিলিত \r\nহয়েছে ।&nbsp;</p><p>&nbsp;</p><p style=\"text-align: center;\"><img src=\"https://www.dcnaogaon.gov.bd/images/stories/130220.jpg\" style=\"font-size: 13px; line-height: 20px;\" alt=\"130220\" width=\"488\" height=\"201\" border=\"0\"></p><p>&nbsp;</p><p>&nbsp;</p><p>আলোচ্য\r\n নদীত্রয় বর্ষায় স্ফীত হয়ে নৌ-চলাচলের উপযোগী নাব্যতার অধিকারী হলেও খরা\r\n মৌসুমে প্রবাহ হারায়। এসব নদী জেলায় অল্প বিসত্মর মাছের যোগান দেয়, পলি\r\n দ্বারা তীর উর্বর করে, কৃষি জমিতে কিছু সেচ সুবিধাও পাওয়া যায়। তবে কখনো\r\n কখনো বন্যায় দুই তীর পস্নাবিত করে সমূহ ক্ষতির কারণও হয়। উলিখিত নাগর, \r\nচিরি, তুলসীগঙ্গা নদী এখন মৃতপ্রায়। শিব, ফকিরনী, নলামারা, গুড়নই-এরও \r\nতদ্রুপ অবস্থা।</p><p>&nbsp;</p>এছাড়া নওগাঁ জেলায় বহুসংখ্যক খাড়ি ও বিল \r\nরয়েছে। তাদের মধ্যে সাপাহারে জবই, পোরশার রোকনপুর, নিয়ামতপুরের ছাতড়া, \r\nমান্দার ঠাকুরমান্দা ও বিল উৎরাইল প্রভৃতি সারাবর্ষজীবী। নওগাঁর গুটা, \r\nমনসুর, দীঘলি বিল বিখ্যাত। তবে এককভাবে রাণীনগরের ‘রক্তদহ’ সম্ভবত সর্ববৃহৎ\r\n ও বিখ্যাত। পূর্বকালে নওগাঁ জেলার মধ্য দিয়ে প্রবাহিত গঙ্গা, কৌশকী, নূর,\r\n কম্প, ইছামতী, খয়রা প্রভৃতি নদ-নদীই এসব বিলের সৃষ্টি করেছিল বলে ধারণা \r\nকরা হয়। কারো কারো মতে ঘুকশী আত্রাই নদীর পুরাতন খাত\r\n। বর্ষাকালে বিলগুলো প্রশসত্ম হয়ে বিশেষ করে বিসত্মীর্ণ বরিন্দ অঞ্চলে নৌপথে পণ্য পরিবহণের সুযোগ সৃষ্টি করে।', NULL, 'ভৌগলিক পরিচিতি', NULL, NULL, 'INACTIVE', '2020-07-27 17:38:19', '2021-02-23 22:30:36', NULL, NULL),
