(31, 1, 'আমাদের লক্ষ্য ও উদ্দেশ্য', NULL, '<p><span style=\"font-size:16px\"><big>১। আইনের শাসন সমুন্নত রাখা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>২। প্রত্যেক নাগরিকের নিরাপত্তা নিশ্চিত করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>৩। অপরাধ প্রতিরোধ করা এবং অপরাধীদের সনাক্ত করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>৪। অপরাধীদের আইনের আওতায় নিয়ে আসা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>৫। শান্তি এবং শৃংখলা বজায় রাখা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>৬। পুলিশ এবং জনগণের মধ্যে আস্থা বৃদ্ধি করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>৭। আইন শৃঙ্খলা রক্ষা করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>৮। জেলার সর্বস্তরের নিরাপত্তা বিধান ও জনগনের সেবা করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>৯। অপরাধ দমন করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>১০। সন্ত্রাস ও জঙ্গিবাদ মুক্ত দেশ গড়া।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>১১। দেশকে মাদকমুক্ত করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>১২। নারীর ন্যায্য অধিকার নিশ্চিত করার লক্ষ্যে নারীদেরকে আইনগত সহায়তা প্রদান করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>১৩। যৌতুক মুক্ত দেশ ও সমাজ গড়া।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>১৪। অবৈধ ব্যবসায় বাণিজ্য ও চোরাচালানী বন্ধ করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>১৫। চুরি, ডাকাতি, দস্যুতা, অপহরণ ইত্যাদি বন্ধ করা।</big></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><big>১৬। দুষ্টের দমন ও শিষ্টের লালন করা।</big></span></p>', NULL, 'আমাদের লক্ষ্য ও উদ্দেশ্য', NULL, NULL, 'INACTIVE', '2020-07-27 17:43:14', '2021-02-23 21:46:56', NULL, NULL),
