(35, 1, 'নাগরিক সেবা', NULL, '<div class=\"police-act text-left\">\r\n					<div class=\"cc-text\">\r\n						<p>১। বাংলাদেশ পুলিশ জনগণের সেবা প্রদানকারী একটি প্রতিষ্ঠান। </p>\r\n\r\n						<p>২। জাতী, ধর্ম, বর্ণ ও রাজনৈতিক/সামাজিক/অর্থনৈতিক শ্রেণি \r\nনির্বিশেষে দেশের প্রতিটি থানায় সলক নাগরিকের সমান আইনগত অধিকার লাভের \r\nসুযোগ রয়েছে। </p>\r\n\r\n						<p>৩। থানায় আগত সাহায্য প্রার্থীদের আগে আসা ব্যক্তিকে আগে সেবা প্রদান করা হবে। </p>\r\n\r\n						<p>৪। থানায় সাহায্যপ্রার্থী সকল ব্যক্তিতে থানা পুলিশ সম্মান প্রদর্শন করবে এবং সম্মান সম্বোধন করবে। </p>\r\n\r\n						<p>৫। থানায় জিডি করতে আসা ব্যক্তির আবেদনকৃত বিষয়ে ডিউটি অফিসার \r\nসর্বাত্মক সহযোগীতা প্রদান করবে এবং আবেদনের দ্বিতীয় কপিতে জিডি নম্বর, \r\nতারিখ এবং সংশ্লিষ্ট অফিসারের স্বাক্ষর ও সীলমোহরসহ তা আবেদনকারীকে প্রদান \r\nকরতে হবে। বর্ণিত জিডি সংক্রান্ত বিষয়ে যথাশীঘ্র সম্ভব ব্যবস্থা গ্রহণ করা \r\nহবে এবং      গৃহীত ব্যবস্থা পুনরায় আবেদনকারীকে অবহিত করা হবে। </p>\r\n\r\n						<p>৬। থানায় মামলা করতে আসা ব্যক্তির মৌখিক/লিখিত বক্তব্য ভারপ্রাপ্ত\r\n কর্মকর্তা কর্তৃক এজাহারভূক্ত করবে এবং আগত ব্যক্তিকে মামমলার নম্বর, \r\nতারিখ ধারা এবং তদন্তকারী অফিসারের নাম ও পদবী অবহিত করবে। তদন্তকারী \r\nঅফিসার এজাহারকারীরর সাথে নিয়মিত যোগাযোগ রক্ষা করে তাকে তদন্তের অগ্রগতি \r\nসম্পর্কে অবহিত করবে এবং তদন্ত সমাপ্ত হলে তাকে ফলাফল লিখিতভাবে জানিয়ে \r\nদিবে।</p>\r\n\r\n						<p>৭। থানায় মামলা করতে আসা কোন ব্যক্তির মামলা ভারপ্রাপ্ত \r\nকর্মকর্তা/থানার ডিউটি অফিসার এন্ট্রি করতে অপারগতা প্রকাশ করলে তখন উক্ত \r\nবিষয়টির উপর প্রতিকার চেয়ে নিম্নবর্ণিত নিয়মানুযায়ী আবেদন করবেনঃ-</p>\r\n						<ul><li>ক. মেট্রোপলিটন এলাকার সহকারী পুলিশ কমিশনার (জোন)/জেলায় সহকারী পুলিশ সুপার (সার্কেল) এর নিকট আবেদন করবেন। </li><li>খ. তিনি যদি উক্ত বিষয়ে ব্যবস্থা গ্রহণ না করেন তা হলে উক্ত ব্যক্তি ডিপুটি পুলিশ কমিশনার/জেলা পুলিশ সুপারের নিকট আবেদন করবেন। </li><li>গ. অতঃপর তিনও যদি উক্ত ব্যক্তির বিষয়ে কোন ব্যবস্থা গ্রহণ না \r\nকরেন তা হলে উক্ত ব্যক্তি সংশ্লিষ্ট পুলিশ কমিশনার/ডিআইজি’র নিকট আবেদন \r\nকরবেন। </li><li>ঘ. তারা কেউ উক্ত বিষয়ে কোন ব্যবস্থা গ্রহণ না করলে মহা পুলিশ পরিদর্শকের নিকট উক্ত বিষয়ে প্রতিকার চেয়ে আবেদন করবেন। </li></ul>\r\n\r\n						<p>৮। আহত ভিকটিমকে থানা হতে সার্বিক সহযোগীতা প্রদান করা হবে এবং এ বিষয়ে থানার সকল মেডিক্যাল সার্টিফিকেট সংগ্রহ করবে। </p>\r\n\r\n						<p>৯। শিশু/কিশোর অপরাধী সংক্রান্ত বিষয়ে শিশুআইন, ১৯৭৪ এর বিধান \r\nঅনুসরণ করা হবে এবং তারা যাতে কোনভাবেই বয়স্ক অপরাধীর সংস্পর্শে না আসতে \r\nপারে। তা নিশ্চিত করা হবে। এ জন্য দেশের সকল থানায় পর্যায়ক্রমে কিশোর \r\nহাজতখানা ব্যবস্থা করা হবে। </p>\r\n\r\n						<p>১০। মহিলা আসামমী/ভিকটিমকে  যথাসম্ভব মহিলা পুলিশের মাধ্যেমে সার্বিক নিরাপত্তা নিশ্চিত করবেন। </p>\r\n						<p>১১। দেশের কিছু সংখ্যক থানায় ওয়ানস্টপ সার্বিস ডেলিভারী সেন্টার \r\nচালূ করা হয়েছে। পর্যায়ক্রমে উক্ত ওয়ানস্টপ সার্ভিস ডেলিভারী সেন্টার দেশের\r\n সকল থানায় প্রবর্তন করা হবে। </p>\r\n						<p>১২। আহত/মানসিকভাবে বিপর্যাস্ত ভিকটিমকে সার্বিক সহযোগীতার জন্য দেশের সকল থানায় পর্যায়ক্রমে ভিকটিম সাপোর্ট ইউনিট চালুকরা হবে। </p>\r\n						<p>১৩। পাসপোর্ট/ভেরিফিকেশন/আগ্নেয়াস্ত্রের লাইসেন্স ইত্যাদি বিষয়ে \r\nসকল অনুসন্ধান প্রাপ্তির ৩ (তিন) দিনের মধ্যে তদন্ত সম্পন্ন করে থানা হতে \r\nসংশ্লিষ্ট ইউনিটে প্রতিবেদন প্রেরণ করা হবে। </p>\r\n						<p>১৪। থানা হতে বর্ণিত আইনগত সহযোগিতা না পাওয়া গেলে বা কোন পুলিশ \r\nসদস্যের বিরুদ্ধে কোন অভিযোগ থাকলে উর্ধ্বতন কর্তৃপক্ষ বরাবর অভিযোগ দাখিল \r\nকরা যাবে। সেইক্ষেত্রে উর্ধ্বতন কর্তৃপক্ষঃ</p>\r\n						<ul><li>ক. লিখিত অভিযোগ প্রাপ্তির ১৫ (পনেরো) দিনের মধ্যে কার্যাকর আইনগত ব্যবস্থা গ্রহণ করবেন এবং তা অবিযোগকারীকে অবহিত করবেন।</li><li>খ. ব্যক্তিগতভাবে হাজির হওয়া ব্যক্তির বক্তব্য মনোযোগ সহকারে শুনবেন, প্রয়োজনীয় ব্যবস্থা গ্রহণ করবেন এবং তা অবিযোগকারীকে জানাবেন।</li><li>গ. টেলিফোনে প্রাপ্ত সংবাদের ভিত্তিতে প্রয়োজনীয় ব্যবস্থা গ্রহণ করবেন।</li></ul>\r\n\r\n						<p>১৫। সকল থানায় মেট্রোপলিটন এলাকার জন্য কমিশনার, অতিরিক্ত \r\nকমিশনার, সংশ্লিষ্ট জয়েন্ট কমিশনার, ডিসি, এডিসি এবং জোনাল এসি এবং জেলার \r\nজন্য পুলিশ সুপার, অতিরিক্ত পুলিশ সুপার, এএসপি (হেডকোয়ার্টার্স), \r\nসংশ্লিষ্ট সার্কেল এএসপি এবং থানার ভারপ্রাপ্ত কর্মকর্তা টেলিফোন নম্বর \r\nপ্রকাশ্য স্থানে প্রদর্শিত হবে। </p>\r\n\r\n						<p>১৬। মেট্রো পলিটন ও জেলায় কর্তব্যরত সকল পর্যায়ের অফিসারগণ প্রতি \r\nকারযদিবসে নির্ধারিত সময়ে সকল সাহায্যপ্রার্থীকে সাহায্য প্রদান করবে। </p>\r\n\r\n						<p>১৭। থানার পুলিশ সদস্যগণ কমিউনিটি সাথে নিরবিচ্ছিন্ন  যোগাযোগ রক্ষা করবেন এবং কম্যুনিটি ওরিয়েন্টেড পুলিশ সার্ভিস চালু করবেন। </p>\r\n\r\n						<p>১৮। উর্দ্ধতন পুলিশ কর্মকর্তাগণ নিয়মিত কম্যুনিটির সহিত অপরাধ \r\nদমনমূলক/জনসংযোগমূলক সভা করবেন এবং সামাজিক সমস্যাসমূহের আইনগত সমাধানের \r\nপ্রয়াস চালাবেন।</p>\r\n\r\n						<p>১৯। বিদেশে চাকুরী/উচ্চ শিক্ষার জন্য গমনেচ্ছু প্রার্থীদের পুলিশ ক্লিয়ারেন্স  সার্টিফিকেট প্রদান করবেন।</p>\r\n\r\n						<p>২০। ব্যাংক হতে কোন প্রতিষ্ঠান অধিক পরিমাণ টাকা উত্তোলন করলে \r\nউক্ত টাকা নিরাপদে নেওয়ার জন্য চাহিদা অনুযায়ী পুীলশ এস্কর্টের ব্যবস্থা \r\nকরা হবে।</p>\r\n\r\n						<p>২১। মেট্রোপলিটন শহর/জেলা শহরে যানবাহন নিয়ন্ত্রণে ট্রাফিক বিভাগ,\r\n ট্রাফিক সংশ্লিষ্ট কি কি সেবা প্রদান করছে তা প্রকাশ্য স্থানে প্রদর্শিত \r\nহবে।</p>\r\n					</div>\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n					\r\n				</div>', NULL, 'নাগরিক সেবা', NULL, NULL, 'INACTIVE', '2020-07-27 17:44:42', '2021-02-23 21:48:16', NULL, NULL),
