(42, 1, 'পুলিশ সুপার দায়িত্ব ও কর্তব্য', NULL, '<div class=\"pull-left\"><p style=\"margin-left:0in; margin-right:0in\"><span style=\"color:#e74c3c\"><strong><u><span style=\"font-size:24px\">সেবার তালিকা</span></u></strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:24px\"><span style=\"color:#e74c3c\"><u><strong>অত্র পুলিশ সুপারের কার্যালয় হতে সরাসরি যে সকল সেবা সমূহ পাবেনঃ</strong></u><strong>-</strong></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">ক) যে কোন আইনানুগ সহযোগিতা বা পরামর্শ পাবেন।</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">খ)&nbsp;অফিস চলাকালীন সময়ে মাননীয় পুলিশ সুপারের সঙ্গে সাক্ষাৎ করার সুবিধা।</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">গ) থানা/পুলিশ\r\n ফাঁড়ি/পুলিশ তদন্ত কেন্দ্রে মামলা/জিডি গ্রহনে অনীহা প্রকাশ করলে বিষয়টি\r\n অত্রদপ্তরের প্রধানকে অবহিত করলে আইনগত সহযোগিতা পাবেন।</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">ঘ)&nbsp;অত্র জেলার\r\n ভিতরে যে কোন স্থানে আইন-শৃংখলার অবনতি ঘটলে বা কোন মারাত্বক দাঙ্গা \r\nহাঙ্গামা হওয়ার সম্ভাবনা থাকিলে &nbsp; &nbsp;উক্ত স্থানে পুলিশ ক্যাম্পের \r\nপ্রয়োজনীয়তা অনুভব করলে মাননীয় পুলিশ সুপার মহোদয় বরাবর আবেদন করুন।</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\">ঙ)&nbsp;আপনার কোন \r\nসামাজিক/সাংস্কৃতিক অনুষ্ঠানে নিরাপত্তার লক্ষ্যে পুলিশ ফোর্সের \r\nপ্রয়োজনীয়তা দেখা দিলে মাননীয় পুলিশ সুপার, জেলা বিশেষ শাখা, </span><span style=\"font-size:18px\"><span>নওগাঁ</span> মহোদয় বরাবর আবেদন করুন।</span></p>\r\n</div>', NULL, 'পুলিশ সুপার দায়িত্ব ও কর্তব্য', NULL, NULL, 'INACTIVE', '2020-07-27 17:48:56', '2021-02-23 21:41:50', NULL, NULL),
