(75, 1, 'পুলিশ ক্লিয়ারেন্স', NULL, '<h4>পুলিশ ক্লিয়ারেন্স সার্টিফিকেট পাওয়ার জন্য প্রয়োজনীয় শর্তাবলী<strong></strong></h4><strong><br>১।\r\n আবেদনকারীর পাসপোর্টে উল্লেখিত স্থায়ী কিংবা বর্তমান ঠিকানার যে কোন একটি \r\nঅবশ্যই সংশ্লিষ্ট মেট্রোপলিটন / জেলা পুলিশের আওতাধীন এলাকায় অবস্থিত হতে \r\nহবে এবং আবেদনকারীকে/ যার জন্য পুলিশ ক্লিয়ারেন্স সার্টিফিকেট চাওয়া হয়েছে \r\nতাকে অবশ্যই ঐ ঠিকানার বাসিন্দা হতে হবে ।<br><br>২। বিদেশে অবস্থানকারী \r\nকোন ব্যক্তির পুলিশ ক্লিয়ারেন্স সার্টিফিকেট পাওয়ার জন্য তিনি যে দেশে \r\nঅবস্থান করছেন সে দেশে বাংলাদেশ দূতাবাস/হাইকমিশনের সংশ্লিষ্ট কর্মকর্তা \r\nকর্তৃক পাসপোর্টের তথ্য পাতার সত্যায়িত কপি তার পক্ষে করা আবেদনের সাথে \r\nদাখিল করতে হবে ।<br><br>৩। মেশিন রিডেবল পাসপোর্টের (এম আর পি) এর \r\nক্ষেত্রে যদি পাসপোর্টে ঠিকানা উল্লেখ না থাকে তবে ঠিকানার প্রমাণ স্বরূপ \r\nজাতীয় পরিচয় পত্র/জন্ম নিবন্ধন সনদপত্র/স্থানীয় ওয়ার্ড কাউন্সিলর এর \r\nসনদপত্রের ফটোকপি ১ম শ্রেণীর সরকারী গেজেটেড কর্মকর্তা দ্বারা সত্যায়িত করে\r\n দাখিল করতে হবে ।<br>৪। সোনালী ব্যাংকের কোড নং-১-৭৩০১-০০০১-২৬৮১ তে ৫০০ টাকা&nbsp; ট্রেজারী চালান করতে হবে।<br>৫। পাসপোর্ট সাইজের সত্যায়িত ০১ কপি ছবি।</strong>', NULL, 'পুলিশ ক্লিয়ারেন্স', NULL, NULL, 'INACTIVE', '2020-07-27 18:23:27', '2021-02-23 21:30:10', NULL, NULL),
(76, 1, 'পাসপোর্ট ভেরিফিকেশন', NULL, '<h3>পার্সপোর্ট ভেরিফিকেশনঃ-</h3>সাধারনত বিদেশে চাকুরী, ব্যবসা, ভ্রমন, \r\nপড়ালেখা ইত্যাদির জন্য পাসপোর্ট ভেরিফিকেশন করা হয়৷ পাসপোর্ট ভেরিফিকেশন \r\nফরম ইন্টারনেট বা সংশিস্নষ্ট পাসপোর্ট অফিস থেকে দুই কপি সংগ্রহ পূর্বক \r\nপূরণ করে তা পাসপোর্ট অফিসে জমা দিতে হয়৷ পাসপোর্ট অফিস তা ভেরিফিকেশনের \r\nজন্য প্রার্থী সংশ্লিষ্ট জেলা পুলিশ অফিসে প্রেরণ করে৷ পুলিশ সুপার অফিসের \r\nজেলা বিশেষ শাখা লোক মারফত নিম্নলিখিত বিষয় সরেজমিনে পরিদর্শন ও পর্যবেক্ষণ\r\n করে রিপোর্ট তৈরী করেন।<br>ক) নাম-ঠিকানা সঠিক আছে কিনা<br>খ) জন্ম সূত্রে বাংলাদেশী নাগরিক কিনা৷ <br>গ) শিক্ষাগত যোগ্যতা সঠিক আছে কিনা ৷ <br>ঘ) ব্যক্তিচরিত্র সংক্রান্ত৷ <br>ঙ) মামলা আছে কি না তা যাচাই ৷ <br>চ) কোন রাজনৈতিক দলের সদস্য আছে কি না তা যাচাই ৷ <br>ছ) থানা রেকর্ডে তার সম্পর্কে কোন কিছু লিখিত আছে কি না তা যাচাই ৷ <br>জ)\r\n বর্তমান ও স্থায়ী ঠিকানা যাচাই ৷ পুলিশ সুপার কার্যালয়ের জেলা বিশেষ শাখা \r\nথেকে উক্ত তথ্যগুলো সরেজমিনে পরিদর্শন ও পর্যবেক্ষণ দ্বারা রিপোর্ট সংগ্রহ \r\nকরে রিপোর্ট প্রদান করা হয়৷ <br><br>প্রার্থী পাসপোর্ট ফরমে নিম্নলিখিত কাগজপত্র জমা দিতে হয়ঃ- <br><br>ক) প্রার্থীর আইডি কার্ডের ফটোকপি <br>খ) জন্মসনদ/ভোটার আইডি কার্ডেও ফটোকপি/নাগরিকত্ব সনদ <br>গ) বাবামায়ের/স্বামীর/ভাই/বোন অথবা অন্যান্য অভিভাবকের আইডির ফটোকপি <br>ঘ) কাবিননামার ফটোকপি <br>ঙ) শিক্ষা সনদের ফটোকপি <br>চ) বাড়ির দলিল/বিদু্যত্‍ বিল/গ্যাস বিলের ফটোকপি <br>ছ) স্টুডেন্ট আইডি/ট্রেড লাইন্সেস এর ফটোকপি/পেশা সংক্রান্ত প্রমাণ পত্র <br>জ) ওয়াড কমিশনারের সনদ <br>ঝ) বাবা/মায়ের পাসপোর্টেও ফটোকপি <br>ঞ) এনওসি <br>ট) ভাড়া বাড়ির ক্ষেত্রে বাড়ির মালিকের আইডির ফটোকপি/বিদু্যত্‍ বিল/দলিল/গ্যাস বিলের ফটোকপি <br>ঠ) বাড়ির মালিকের অঙ্গীকারনামা <br>ড) ট্রাভেল এজেন্সির অঙ্গীকারনামা <br>ঢ) দাদা/দাদী/নানা/নানী/ভাই/বোন/অন্যান্য অভিভাবকের অঙ্গীকারনামা <br>ত) তালাকনামার ফটোকপি <br>থ) পিতামাতার ভোটার আইডি কার্ডেও ফটোকপি <br><br>উপরোক্ত বিষয়গুলি তদন্তকারী অফিসার যাচাই বাছাই কওে রিপোর্ট প্রস্তুুত করেন৷ উক্ত অফিসারের তথ্যেও ভিত্তিতে এ রিপোর্ট দাখিল করা হয়৷', NULL, 'পাসপোর্ট ভেরিফিকেশন', NULL, NULL, 'INACTIVE', '2020-07-27 18:23:46', '2021-02-23 21:35:24', NULL, NULL),
(77, 1, 'চাকুরির ভেরিফিকেশন', NULL, 'চাকুরির ভেরিফিকেশনঃ <br>সাধারনত চাকুরির ভেরিফিকেশনের জন্য ভেরিফিকেশন ফরম\r\n রয়েছে৷ তা সংশিস্নষ্ট সংস্থা কর্তৃক দুই কপি ফরম চাকুরির প্রাথর্ীকে \r\nসরবরাহ করা হয়৷ চাকুরির প্রার্থী তা পূরণ করে সংশিস্নষ্ট অফিসে জমা দেয়৷ \r\nসংশ্লিষ্ট অফিস নিম্নলিখিত বিষয়ের তথ্য জানার জন্য সংশিস্নষ্ট পুলিশ \r\nসুপারের অফিসে উক্ত দুই কপি ফরম প্রেরন করেঃ- <br><br>ক) নাম-ঠিকানা সঠিক আছে কিনা (খ) জন্ম সূত্রে বাংলাদেশী নাগরিক কিনা৷ <br>গ) শিক্ষাগত যোগ্যতা সঠিক আছে কিনা ৷ <br>ঘ) ব্যক্তিচরিত্র সংক্রান্ত৷ <br>ঙ) মামলা আছে কি না তা যাচাই ৷ <br>চ) কোন রাজনৈতিক দলের সদস্য আছে কি না তা যাচাই ৷ <br>ছ) থানা রেকর্ডে তার সম্পর্কে কোন কিছু লিখিত আছে কি না তা যাচাই ৷ <br>জ) বর্তমান ও স্থায়ী ঠিকানা যাচাই ৷ <br>পুলিশ\r\n সুপার কার্যালয়ের জেলা বিশেষ শাখা থেকে উক্ত তথ্যগুলো সরেজমিনে পরিদর্শন ও\r\n পর্যবেক্ষণ দ্বারা রিপোর্ট সংগ্রহ করে রিপোর্ট প্রদান করা হয়৷', NULL, 'চাকুরির ভেরিফিকেশন', NULL, NULL, 'INACTIVE', '2020-07-27 18:24:07', '2021-02-23 21:38:41', NULL, NULL),
