(110, 1, 'উইমেন্স সাপোর্ট সেন্টার', NULL, '<h4>সেবা প্রদানের সংক্ষিপ্ত বিবরনঃ</h4>০১. অভিযোগকারী প্রথমে এসে \r\nদাম্পত্য কলহ/যৌতুক সংক্রান্ত/অন্যান্য বিষয়ে অভিযোগ করে মাননীয় পুলিশ \r\nসুপাররে বরাবর।&nbsp; পুলিশ সুপার উক্ত অভিযোগটি উইমেন্স সাপোর্ট সেন্টারে \r\nপ্রেরন করেন।<br><br>০২.উইমেন্স সাপোর্ট সেন্টার প্রাপ্ত হওয়ার পর সাপোর্ট \r\nসেন্টারের ইনচার্জ অভিযোগটি পর্যালোচনা করিয়া বাদি বিবাদীর ঠিকানা \r\nসংশ্লিষ্ট থানার মাধ্যমে ধার্য তারিখে হাজির হওয়ার জন্য নোটিশ প্রদান করেন।<br><br>০৩.\r\n বাদি বিবাদী উপস্থিত হইলে বাদির পারিবারিক অভিযোগটি মনযোগ সহকাররে শ্রবণ \r\nকরিয়া অভিযোগের ভিত্তিতে উভয়ের শালিসদারদের সাথে কাউন্সিলিং এর মাধ্যমে \r\nসমঝোতা করা হয়।<br><br>০৪. বাদি বিবাদী খুব সহজেই হয়রানী না হয়ে বা আর্থিক ক্ষতিগ্রস্থ না হয়ে এখান থেকে সেবা পেয়ে থাকেন।<br><br>০৫.\r\n উইমেন্স সাপোর্ট সেন্টারে আগতদের কোন দালালের মাধ্যমে আসার প্রয়োজন হয় না।\r\n অভিযোগকারীরা সরাসরি আসিয়া তাদের অভিযোগ মাননীয় পুলিশ সুপার মহোদয়ের নিকট \r\nদাখিল করতে পারেন।<br><br>&nbsp;০৬. এখানে ধনী, গরীব,&nbsp; সুবিধা বঞ্চিত এবং প্রতিবন্ধিদের পারিবারিক বিষয়গুলি ব্যাপারে সেবা দিয়ে থাকে।<br><br>উইমেন্স সাপোর্ট সেন্টারের সংক্ষিপ্ত বিবরণঃ<br><br>নোয়াখালী\r\n উইমেন্স সাপোর্ট সেন্টারে স্বামী স্ত্রীর মধ্যে মনমালিন্য, যৌতুক সমস্যা, \r\nপারিবারিক কলহ ইত্যাদি ছোটখাট সমস্যা আলোচনার মাধ্যমে সম্ভাব্য নিষ্পত্তির \r\nলক্ষে একজন নারী এসআই ও ০২ জন নারী কনস্টেবল এর সমন্বয়ে গঠিত। স্বামী \r\nস্ত্রীর দাম্পত্য ও পারিবারিক জীবনের কোন সমস্য ও অভিযোগ নিয়ে সেবা \r\nপ্রত্যাশি ভিকটিম থানায় হাজির হলে থানায় মামলা রুজুর পূর্বে তাকে/তাদেরকে \r\nউইমেন্স সাপোর্ট সেন্টারে পাঠানো হয়। অভিযোগকারী ভিকটিম&nbsp; উইমেন্স সাপোর্ট \r\nসেন্টারে আসার পর দায়িত্বপ্রাপ্ত এসআই ভিকটিমকে একটি লিখিত অভিযোগ দেয়ার \r\nজন্য বলে। উক্ত অভিযোগটি মাননীয় পুলিশ সুপার নিজে অথবা পুলিশ সুপারের পক্ষে\r\n অতিরিক্ত পুলিশ সুপার(প্রশাসন ও অপরাধ)/অতিরিক্ত পুলিশ সুপার(সদর) \r\nস্বাক্ষর করে উইমেন্স সাপোর্ট সেন্টারে প্রেরণ করেন। সাপোর্ট সেন্টারে \r\nঅভিযোগটি আসার পর অভিযোগ কারী এবং অভিযুক্তকে হাজির হওয়ার জন্য সংশ্লিষ্ট&nbsp; \r\nথানার মাধ্যমে নোটিশ প্রদান করা হয়। উভয়পক্ষ আসার পর তাদের এবং তাদের \r\nমনোনিত প্রতিনিধিদের সাথে আলাপ আলোচনার মাধ্যমে বিষয়টি নিষ্পত্তির চেষ্টা \r\nকরা হয়। উভয় পক্ষ সম্মতি থাকলে বিষয়টি এখানেই নিষ্পত্তি হয়। নতুবা \r\nঅভিযোগকারীকে থানায় গিয়ে নিয়মিত মামলা/আদালতের স্মরাণাপন্ন হওয়ায়র জন্য \r\nপরামর্শ প্রদান করা হয়।', NULL, 'উইমেন্স-সাপোর্ট-সেন্টার', NULL, NULL, 'INACTIVE', '2021-02-23 21:23:33', '2021-02-23 21:23:33', NULL, NULL),
(111, 1, 'নারী, শিশু ও প্রতিবন্ধী ডেস্ক', NULL, '<div class=\" notice-content\">\r\n                                        \r\n                    <p>\r\n                        <span style=\"font-size:16px\">মাননীয় প্রধানমন্ত্রীর নির্দেশনায় জেলার \r\nপ্রতিটি থানায় নারী, শিশু, বয়স্ক ও প্রতিবন্ধী সার্ভিস ডেস্ক চালু করা \r\nহয়েছে। থানা এলাকার নারী, শিশু, বয়স্ক ও প্রতিবন্ধী যে কোন ব্যক্তি যে কোন \r\nআইনগত সহায়তা পাবেন খুব সহজে&nbsp;এ সার্ভিস ডেস্ক থেকে। </span>\r\n                    </p>\r\n\r\n\r\n                </div>', NULL, 'নারী-শিশু-ও-প্রতিবন্ধী-ডেস্ক', NULL, NULL, 'INACTIVE', '2021-02-23 21:25:06', '2021-02-23 21:25:06', NULL, NULL),
