(43, 1, NULL, 'পুলিশ সুপারের কার্যালয়, নওগাঁয় পুলিশের উর্দ্ধতন কর্মকর্তাদের সাথে বিশেষ মত বিনিময়', NULL, NULL, '<p><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql gk29lw5a a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d9wwppkn fe6kdd0r mau55g9w c8b282yb hrzyx87i jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\">অদ্য\r\n ২২/১২/২০২০ খ্রিঃ তারিখে পুলিশ সুপারের কার্যালয়, নওগাঁয় পুলিশের উর্দ্ধতন\r\n কর্মকর্তাদের সাথে বিশেষ মত বিনিময় সভায় অংশগ্রহণ করেন সভাপতি বাংলাদেশ \r\nস্কাউটস, প্রাক্তন এসডিজি বিষয়ক মূখ্য সমন্বয়ক ও মূখ্য সচিব, \r\nপ্রধানমন্ত্রীর কার্যালয় জনাব মোঃ আবুল কালাম আজাদ; অতিরিক্ত সচিব, \r\nচেয়ারম্যান রাজশাহী আরডিএ জনাব মোঃ আনোয়ার হোসেন;জেলা প্রশাসক, নওগাঁ জনাব \r\nমোঃ হারুন অর রশিদ, এবং নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব \r\nআবদুল মান্নান মিয়া, বিপিএম।  প্রধান অতিথি মাননীয় প্রধানমন্ত্রীর স্বপ্ন \r\nএবং জাতির পিতা বঙ্গবন্ধুর সোনার বাংলাদেশ গড়ার ক্ষেত্রে পুলিশের ভূমিকা \r\nসম্পর্কে দিক নির্দেশনা মূলক বক্তব্য প্রদান করেন। তাঁর অনুপ্রেরণামূলক \r\nউপস্থাপনায় সন্ধ্যাটি  মনোরম ও উপভোগ্য হয়ে ওঠে।  পুলিশের আতিথেয়তায় \r\nমুগ্ধ হয়ে  তিনি পুলিশ সুপারসহ জেলা পুলিশের সকল সদস্যকে ধন্যবাদ জ্ঞাপন \r\nকরেন। পরিশেষে জেলা পুলিশের পক্ষ থেকে তাঁকে  চমৎকার একটি শুভেচ্ছা  উপহার \r\nপ্রদান করা হয়।</span></p>', 'posts/February2021/QnkdeW2yqaKqD6dWxq3H.jpg', '-8', NULL, NULL, 'PUBLISHED', 0, '2021-01-31 06:16:06', '2021-02-23 19:47:33', NULL, NULL, '[]'),
