(46, 1, NULL, 'শীতার্ত_মানুষের_পাশে_নওগাঁ_জেলা_পুলিশ', NULL, NULL, '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_jf\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql gk29lw5a a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d9wwppkn fe6kdd0r mau55g9w c8b282yb hrzyx87i jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\"><span><a class=\"oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl q66pz984 gpro0wi8 b1v8xokw\" href=\"https://www.facebook.com/hashtag/%E0%A6%B6%E0%A7%80%E0%A6%A4%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%A4_%E0%A6%AE%E0%A6%BE%E0%A6%A8%E0%A7%81%E0%A6%B7%E0%A7%87%E0%A6%B0_%E0%A6%AA%E0%A6%BE%E0%A6%B6%E0%A7%87_%E0%A6%A8%E0%A6%93%E0%A6%97%E0%A6%BE%E0%A6%81_%E0%A6%9C%E0%A7%87%E0%A6%B2%E0%A6%BE_%E0%A6%AA%E0%A7%81%E0%A6%B2%E0%A6%BF%E0%A6%B6?__eep__=6&amp;__cft__[0]=AZWKK116Qa4RrB4Zs66o3W0HeTaMe6nXofwuX8kwsg7OUgqOjYJke1spJRLEs7dMe0RY6SpDapWfFy4UoPqk28yYjWc8oWu1ofUKxXpkQqU0Vo6ZpcjXwkH-papjR0M851CX5QMKd-bh25HBXMjnR_aG&amp;__tn__=*NK-R\" role=\"link\" tabindex=\"0\">#শীতার্ত_মানুষের_পাশে_নওগাঁ_জেলা_পুলিশ</a></span></div><div dir=\"auto\" style=\"text-align: start;\">অদ্য ১২/১২/২০২০খ্রি. তারিখে নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম মহোদয়ের উদ্যোগে জেলার মহাদেবপুর থানাধীন সরস্বতীপুরে এতিম শিশু শিক্ষার্থীদের মাঝে শীত নিবারনের জন্য গরম কাপড় (কম্বল) বিতরন করা হয়। পুলিশ সুপার মহোদয়ের তত্বাবধানে অতিরিক্ত পুলিশ সুপার (প্রশাসন) জনাব মোঃ রকিবুল আক্তার শিক্ষার্থীদের মাঝে কম্বল বিতরণ করেন। এসময় আরো উপস্থিত ছিলেন, মহাদেবপুর থানার ওসি জনাব মোঃ নজরুল ইসলাম জুয়েল ও নওহাটা পুলিশ ফাঁড়ি ইনচার্জ এস আই জিয়াউর রহমান সহ থানার কর্মকর্তাগণ।</div></div></span></div></div></div></div>', 'posts/February2021/Cnce7JsIFDEezOHZrAq6.jpg', '-9', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 19:51:44', '2021-02-23 19:51:44', NULL, NULL, '[]'),
(47, 1, NULL, '\"প্রেমের ফাঁদে ফেলে সর্বস্ব হাতিয়ে নেয়া চক্রের মূল হোতাসহ ৭ জন সদস্যকে আটক করেছে নওগাঁ সদর থানা পুলিশ\"', NULL, NULL, '<div class=\"\" dir=\"auto\"><div class=\"ecm0bbzt hv4rvrfc ihqw7lf3 dati1w0a\" data-ad-comet-preview=\"message\" data-ad-preview=\"message\" id=\"jsc_c_j2\"><div class=\"j83agx80 cbu4d94t ew0dbk1b irj2b8pg\"><div class=\"qzhwtbm6 knvmm38d\"><span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql gk29lw5a a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d9wwppkn fe6kdd0r mau55g9w c8b282yb hrzyx87i jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\"><div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"><div dir=\"auto\" style=\"text-align: start;\">\"প্রেমের ফাঁদে ফেলে সর্বস্ব হাতিয়ে নেয়া চক্রের মূল হোতাসহ ৭ জন সদস্যকে আটক করেছে নওগাঁ সদর থানা পুলিশ\"             </div><div dir=\"auto\" style=\"text-align: start;\"> ভিকটিম মোঃ নাসির উদ্দিন এর সাথে মোছাঃ বুলবুলি এর মোবাইল ফোনের মাধ্যমে পরিচয় হয়। ধীরে ধীরে তাদের মধ্যে সুসম্পর্ক গড়ে উঠলে মোঃ নাসির উদ্দিনকে বুলবুলির ভাড়া বাসায় দাওয়াত করেন। সে দাওয়াত গ্রহণ করে  তার বাসায় গেলে গতকাল ১২/১২/২০২০ তারিখ বেলা ০৩.৩০ ঘটিকার সময় মোঃ নাসির উদ্দিনকে বুলবুলির সাথে বাসার এক রুমে কৌশলে ঘরে ঢুকিয়ে দিয়ে বাহির হতে তালাবদ্ধ করে দেয় এবং মোবাইল কেড়ে নেয়। চক্রের অন্যান্য সদস্যদের সহায়তায় বুলবুলি তাকে ভয়ভীতি দেখিয়ে ০৫ (পাঁচ) লক্ষ টাকা চাঁদা দাবী করে এবং অন্যথায় হত্যার হুমকি দেয়। মোবাইলের মাধ্যমে আসামীরা মোঃ নাসির উদ্দিনকে দিয়ে তাহার পরিবারের সদস্যদের সাথে যোগাযোগ করে ০৫ (পাঁচ) লক্ষ টাকা মুক্তিপণ পাঠানোর কথা বলতে বাধ্য করে। উক্ত ঘটনার বিষয়ে নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম স্যারের নির্দেশনায় জনাব মোঃ রাকিবুল আক্তার, অতিরিক্ত পুলিশ সুপার (প্রশাসন), জনাব আবু সাইদ, অতিরিক্ত পুলিশ সুপার, সদর সার্কেল, নওগাঁ, জনাব মোঃ সোহরাওয়ার্দী হোসেন, অফিসার ইনচার্জ, পুলিশ পরিদর্শক (তদন্ত) জনাব মুঃ ফয়সাল বিন আহসান, পুলিশ পদির্শক (অপারেশন) জনাব মোঃ তাজমিলুর রহমান, এসআই (নিঃ) মোঃ আব্দুল মজিদ, এসআই মোঃ নাজমুল জান্নাত শাহ, এএসআই (নিঃ) মোঃ তারিকুল ইসলাম, এএসআই (নিঃ) মোঃ আব্দুল্লাহ ফারুক ও ফোর্সসহ বিশেষ অভিযান পরিচালনা করে মোঃ নাসির উদ্দিন (৩০) থেকে উদ্ধার করা হয় এবং উক্ত আসামীদেরকে গ্রেফতার করা হয়। বর্ণিত আসামীরা ০১নং আসামী মোছাঃ বুলবুলি বেগমের মাধ্যমে বিভিন্ন লোকজনকে মোবাইল ফোনে কথা বলে প্রেমের ফাঁদে ফেলে কৌশলে নিয়ে এসে আটক করে, বিবস্ত্র করে সাংবাদিক পরিচয়ে ছবি তুলে এবং ফেসবুক সহ সামাজিক যোগাযোগ মাধ্যমে উক্ত ছবি ছড়িয়ে দেওয়ার ভয় দেখিয়ে চাঁদাদাবী সহ চাঁদা আদায় করে থাকে।</div></div></span></div></div></div></div>', 'posts/February2021/OmEj1PvEk2AaiToKWTOx.jpg', '-10', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 19:54:44', '2021-02-23 19:54:44', NULL, NULL, '[]'),
(48, 1, NULL, 'মহান বিজয় দিবস উদযাপন উপলক্ষে নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম মহোদয়ের তত্বাবধানে জেলার ১১টি থানায় অফিসার ফোর্সদের জন্য বিশেষ প্রীতিভোজের আয়োজন করা হয়।', NULL, NULL, '<span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql gk29lw5a a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d9wwppkn fe6kdd0r mau55g9w c8b282yb hrzyx87i jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\">মহান\r\n বিজয় দিবস উদযাপন উপলক্ষে নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব\r\n আবদুল মান্নান মিয়া বিপিএম মহোদয়ের তত্বাবধানে জেলার ১১টি থানায় অফিসার \r\nফোর্সদের জন্য বিশেষ প্রীতিভোজের আয়োজন করা হয়। প্রীতিভোজ শেষে কেক কেটে \r\nসকলে বিজয় দিবস উদযাপন করেন। এছাড়াও প্রতিটি থানায় প্রজেক্টরের মাধ্যমে \r\nবাংলাদেশ পুলিশের সম্মানিত অভিভাবক  শ্রদ্ধেয় আইজিপি মহোদয়ের বিভিন্ন \r\nদিকনির্দেশনামূলক বক্তব্য প্রচার করে সকলকে শোনানো হয়। পুলিশ সুপার মহোদয়ের\r\n একান্ত উদ্যোগে সম্মানিত আইজিপি মহোদয়ের  সর্বকালের শ্রেষ্ঠ বাঙালি জাতির \r\nপিতা বঙ্গবন্ধু শেখ মুজিবুর রহমান এঁর ভাস্কর্যের অবমাননা সংক্রান্তে \r\nপ্রতিবাদ মূলক বক্তব্য নওগাঁ জেলার সকল পুলিশ সদস্যকে দেখার সুযোগ করে দেয়া\r\n হয়।</span>', 'posts/February2021/lo77pqtKczPKJNpbt7fp.jpg', '-11', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 19:56:14', '2021-02-23 19:56:14', NULL, NULL, '[]'),
(49, 1, NULL, 'করোনার টিকার গ্রহণ করেছেন  নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম মহোদয়।', NULL, NULL, '<span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql gk29lw5a a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d9wwppkn fe6kdd0r mau55g9w c8b282yb hrzyx87i jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\">সারাদেশের\r\n ন্যায় নওগাঁ জেলার ১১ উপজেলায় আজ কোভিড-১৯ এর টিকাদান কর্মসূচি আরম্ভ \r\nহয়েছে। সম্মুখসারির যোদ্ধাদের অন্যতম বাংলাদেশ পুলিশের গর্বিত সদস্য হিসেবে\r\n আজ টিকা নিলাম। জেলা প্রশাসক, নওগাঁ ও সিভিল সার্জন, নওগাঁ মহোদয়সহ \r\nসম্মুখসারির করোনা যোদ্ধাদের প্রতিনিধিগণ আজ টিকা নিয়েছেন। ধন্যবাদ মাননীয় \r\nপ্রধানমন্ত্রী দেশরত্ন শেখ হাসিনাকে, যিনি দ্রুততম সময়ে সারাদেশব্যাপী \r\nটিকাদান কর্মসূচি আরম্ভ করার প্রয়োজনীয় ব্যবস্থা গ্রহণ করেছেন। সবাই মিলে \r\nকরোনা মোকাবিলা করবো ইনশাআল্লাহ। এই মহামারির দিন কেটে যেয়ে সোনালী আলোয় \r\nউদ্ভাসিত হবে প্রিয় দেশমাতৃকা ও বিশ্বভূমি। প্রিয় নওগাঁবাসীদের নির্ভয়ে \r\nটিকা দান কর্মসূচিতে রেজিষ্ট্রেশনপূর্বক টিকাগ্রহণের আহবান জানাচ্ছি।</span>', 'posts/February2021/ndIoeSp1ZicYBaaldbGa.', '-12', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 19:59:06', '2021-02-23 19:59:06', NULL, NULL, '[]'),
(50, 1, NULL, 'রাজশাহী রেঞ্জের সম্মানিত অভিভাবক জনাব মোঃ আব্দুল বাতেন, বিপিএম, পিপিএম, মহোদয় বাইতুল জান্নাত জামে মসজিদ, পুলিশ লাইন্স, নওগাঁয় স্বাস্থ্যবিধি মেনে জুম্মার নামাজ আদায় করেন।', NULL, NULL, '<span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql gk29lw5a a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d9wwppkn fe6kdd0r mau55g9w c8b282yb hrzyx87i jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\">অদ্য\r\n ১৯ ফেব্রুয়ারি ২০২১ খ্রি. রাজশাহী রেঞ্জের সম্মানিত অভিভাবক জনাব মোঃ \r\nআব্দুল বাতেন, বিপিএম, পিপিএম, রেঞ্জ ডিআইজি মহোদয় বাইতুল জান্নাত জামে \r\nমসজিদ, পুলিশ লাইন্স, নওগাঁয় স্বাস্থ্যবিধি মেনে জুম্মার নামাজ আদায় করেন। \r\nনামাজ শেষে ডিআইজি মহোদয় নিজেদের উপর অর্পিত দায়িত্ব সঠিকভাবে পালনের \r\nপাশাপাশি প্রত্যেক পুলিশ সদস্যকে তাদের নিজ নিজ ধর্মীয় বিশ্বাস অনুযায়ী \r\nসৃষ্টিকর্তার ইবাদত করার আহবান জানান।</span>', 'posts/February2021/JDatzdbho7UeooVFQXfi.jpg', '-13', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 20:00:12', '2021-02-23 20:00:12', NULL, NULL, '[]'),
(51, 1, NULL, '\"নওগাঁয় মুজিব শতবর্ষে শতবলের ক্রিকেট 🏏 টুর্নামেন্ট ২০২১ উদ্বোধন\"', NULL, NULL, '\"নওগাঁয় মুজিব শতবর্ষে শতবলের ক্রিকেট 🏏 টুর্নামেন্ট ২০২১ উদ্বোধন\"', 'posts/February2021/lAmOZ2KEcVXWptyQ5QEa.jpg', '-14', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 20:01:01', '2021-02-23 20:01:01', NULL, NULL, '[]'),
(52, 1, NULL, 'পুলিশ সুপারের কার্যালয়, নওগাঁর সম্মেলন কক্ষে জেলা পুলিশের সদস্যদের সাথে নওগাঁ জেলা প্রেসক্লাবের কার্যনির্বাহী কমিটি ২০২১ এর সদস্যদের মতবিনিময় সভা অনুষ্ঠিত হয়।', NULL, NULL, '<span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql rrkovp55 a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\">অদ্য\r\n ২১/০২/২০২১খ্রি. তারিখে পুলিশ সুপারের কার্যালয়, নওগাঁর সম্মেলন  কক্ষে \r\nজেলা পুলিশের সদস্যদের সাথে নওগাঁ জেলা প্রেসক্লাবের কার্যনির্বাহী কমিটি \r\n২০২১ এর সদস্যদের মতবিনিময় সভা অনুষ্ঠিত হয়।  নওগাঁ জেলার সুযোগ্য পুলিশ \r\nসুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম মহোদয়ের সভাপতিত্বে আয়োজিত \r\nএই মতবিনিময় সভায় পুলিশ সুপার মহোদয় নতুন কার্যনির্বাহী কমিটির সদস্যদের \r\nফুলেল শুভেচ্ছা প্রদান করেন এবং প্রেসক্লাবের পক্ষ থেকেও পুলিশ সুপার \r\nমহোদয়কে ফুলেল শুভেচ্ছা প্রদান করা হয়।</span>', 'posts/February2021/IaDvGXbKCpk9FyMRrf9c.jpg', '-15', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 20:03:16', '2021-02-23 20:03:16', NULL, NULL, '[]'),
(53, 1, NULL, 'মহান শহীদ দিবস ও আন্তর্জাতিক মাতৃভাষা দিবস ২০২১\" - নওগাঁ জেলা পুলিশের পক্ষ থেকে স্বাস্থ্যবিধি মেনে বিনম্র শ্রদ্ধার্ঘ প্রদান করেন নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম মহোদয়', NULL, NULL, '<div dir=\"auto\" style=\"text-align: start;\">মহান শহীদ দিবস ও আন্তর্জাতিক মাতৃভাষা দিবস ২০২১\" </div><div dir=\"auto\" style=\"text-align: start;\">অমর\r\n একুশে ফেব্রুয়ারির প্রথম প্রহরে মাতৃভাষার জন্য আত্মদানকারী সকল বীর \r\nশহীদের প্রতি নওগাঁ জেলা পুলিশের পক্ষ থেকে স্বাস্থ্যবিধি মেনে বিনম্র \r\nশ্রদ্ধার্ঘ প্রদান করেন নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব \r\nআবদুল মান্নান মিয়া বিপিএম মহোদয়। এ সময় উপস্থিত ছিলেন নওগাঁ জেলা পুলিশের \r\nউর্ধতন কর্মকর্তাগণ। এছাড়াও নওগাঁ জেলার প্রতিটি থানায় জেলা পুলিশের পক্ষ \r\nথেকে বিনম্র শ্রদ্ধায় পুষ্পাঞ্জলি জ্ঞাপন করা হয়।</div>', 'posts/February2021/IduOOfsoqpnb7M9oBOfn.jpg', '-16', NULL, NULL, 'PUBLISHED', 0, '2021-02-23 20:04:48', '2021-02-23 20:04:48', NULL, NULL, '[]'),
