(76, 2, NULL, 'কোভিড-১৯ প্রতিরোধে সাধারণ মানুষের মধ্যে সচেতনতা বৃদ্ধির জন্য নওগাঁ পুলিশের প্রচারনা', NULL, NULL, '<span class=\"d2edcug0 hpfvmrgz qv66sw1b c1et5uql rrkovp55 a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db jq4qci2q a3bd9o3v knj5qynh oo9gr5id hzawbc8m\" dir=\"auto\">নওগাঁ\r\n জেলা পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া, বিপিএম  মহোদয়ের \r\nনির্দেশনায় ইং ২৩/০৩/২০২১ তারিখ নওগাঁ সদর মডেল থানা কর্তৃক আয়োজিত \r\nকোভিড-১৯ প্রতিরোধে সাধারণ মানুষের মধ্যে সচেতনতা বৃদ্ধি এবং মাস্ক পড়া \r\nনিশ্চিত করতে নওগাঁ বাস মালিক সমিতি এর সদস্য সহ যৌথভাবে  বালুডাঙ্গা \r\nবাসস্ট্যান্ডে এবং ঢাকা বাসস্ট্যান্ডে প্রচারনা সহ মাস্ক বিতরন করা হয়।</span>', NULL, '-42', NULL, NULL, 'PUBLISHED', 0, '2021-03-24 07:38:59', '2021-03-24 07:38:59', NULL, '[\"posts\\/March2021\\/3iuvFfnndBdOEZi0qqEX.jpg\"]', '[]'),
(77, 1, NULL, 'অদ্য ২৫/০৩/২০২১ খ্রিস্টাব্দ তারিখে গণহত্যা দিবস উপলক্ষে নওগাঁ সদর থানাধীন বোয়ালিয়া ইউনি পাদদেশে মোমবাতি প্রজ্বলন করে শহীদদের প্রতি শ্রদ্ধা জ্ঞাপন', NULL, NULL, 'অদ্য ২৫/০৩/২০২১ খ্রিস্টাব্দ তারিখে গণহত্যা দিবস উপলক্ষে নওগাঁ সদর থানাধীন বোয়ালিয়া ইউনিয়নের দোগাছিতে অবস্থিত গণকবরের পাশে অবস্থিত স্মৃতিস্তম্ভের পাদদেশে মোমবাতি প্রজ্বলন করে শহীদদের প্রতি শ্রদ্ধা জ্ঞাপন করেন নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম মহোদয়।', NULL, '-43', NULL, NULL, 'PUBLISHED', 0, '2021-03-25 11:00:00', '2021-03-29 03:27:37', NULL, '[\"posts\\/March2021\\/MlzsNf92mXCFh3KwRkWt.jpg\",\"posts\\/March2021\\/m0rPpMWIKtK8Ufn5CIEQ.jpg\",\"posts\\/March2021\\/pSqHOuxwFbPaOsokvWdZ.jpg\"]', '[]'),
(79, 1, NULL, 'শহীদ স্মৃতিস্তম্ভে পুষ্পস্তবক অর্পণ করে শ্রদ্ধা জ্ঞাপন', NULL, NULL, 'অদ্য ২৬ শে মার্চ মহান স্বাধীনতা দিবস ও জাতীয় দিবস ২০২১ উপলক্ষ্যে সূর্যোদয়ের সাথে সাথে শহীদ স্মৃতিস্তম্ভে পুষ্পস্তবক অর্পণ করে শ্রদ্ধা জ্ঞাপন করেন নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া বিপিএম মহোদয়। এ সময় উপস্তিত ছিলেন নওগাঁ জেলা পুলিশের উর্ধতন কর্মকর্তাগণ। এছাড়াও প্রতিটি থানা এলাকায় যথাযোগ্য মর্যাদায় পুষ্পস্তবক অর্পণ করে শ্রদ্ধা জ্ঞাপন করা হয়।', NULL, '-44', NULL, NULL, 'PUBLISHED', 0, '2021-03-25 22:14:28', '2021-03-29 03:26:16', NULL, '[\"posts\\/March2021\\/4v3taAkqa2RKCviafWlV.jpg\",\"posts\\/March2021\\/OHs7J9rLrljhIeMGdmVE.jpg\",\"posts\\/March2021\\/jbu4MaJIM6jmuK7HSJ1O.jpg\",\"posts\\/March2021\\/AjkI2zrLy9qmyW2Z4BUW.jpg\",\"posts\\/March2021\\/F4KCb7FA7SSA5lzgXr6L.jpg\",\"posts\\/March2021\\/axXlHEj1MClf7s9qhyKO.jpg\"]', '[]'),
(80, 1, NULL, 'অদ্য ২৫/০৩/২০২১ খ্রিস্টাব্দ তারিখে গণহত্যা দিবস উপলক্ষে নওগাঁ সদর থানাধীন বোয়ালিয়া ইউনি পাদদেশে মোমবাতি প্রজ্বলন করে শহীদদের প্রতি শ্রদ্ধা জ্ঞাপন', NULL, NULL, 'অদ্য ২৫/০৩/২০২১ খ্রিস্টাব্দ তারিখে গণহত্যা দিবস উপলক্ষে নওগাঁ সদর \r\nথানাধীন বোয়ালিয়া ইউনিয়নের দোগাছিতে অবস্থিত গণকবরের পাশে অবস্থিত \r\nস্মৃতিস্তম্ভের পাদদেশে মোমবাতি প্রজ্বলন করে শহীদদের প্রতি শ্রদ্ধা জ্ঞাপন\r\n করেন নওগাঁ জেলার সুযোগ্য পুলিশ সুপার প্রকৌশলী জনাব আবদুল মান্নান মিয়া \r\nবিপিএম মহোদয়।', 'posts/March2021/jIxkmhPqYjkzkOCCUIc4.jpg', '-45', NULL, NULL, 'PUBLISHED', 0, '2021-03-29 03:33:22', '2021-03-29 03:33:22', NULL, NULL, '[]'),
