(6, 'Corona Banner', NULL, 'banner', NULL, NULL, '<marquee direction=\"left\" scrollamount=\"4\" onmouseover=\"this.stop()\" onmouseout=\"this.start()\">\r\n	নো মাস্ক নো সার্ভিস। করোনাভাইরাসের বিস্তার রোধে এখনই ডাউনলোড করুন Corona Tracer BD অ্যাপ। ডাউনলোড করতে ক্লিক করুন <a href=\"https://bit.ly/coronatracerbd\" target=\"_blank\" style=\"color: blue;\" title=\"https://bit.ly/coronatracerbd\">https://bit.ly/coronatracerbd</a>। নিজে সুরক্ষিত থাকুন অন্যকেও নিরাপদ রাখুন। দেশের প্রথম ক্রাউডফান্ডিং প্ল্যাটফর্ম \'একদেশ\'- এর মাধ্যমে আর্থিক অনুদান পৌঁছে দিন নির্বাচিত সরকারি-বেসরকারি প্রতিষ্ঠানসমূহে। ভিজিট করুন <a href=\"//ekdesh.ekpay.gov.bd\" target=\"_blank\" style=\"color: blue;\" title=\"ekdesh.ekpay.gov.bd\">ekdesh.ekpay.gov.bd</a> অথবা <a href=\"//play.google.com/store/apps/details?id=com.synesis.donationapp\" target=\"_blank\" style=\"color: blue;\" title=\"“Ek Desh”\">“Ek Desh”</a> অ্যাপ ডাউনলোড করুন। করোনার লক্ষণ দেখা দিলে গোপন না করে ডাক্তারের পরামর্শের জন্য ফ্রি কল করুন ৩৩৩ ও ১৬২৬৩ নম্বরে। করোনাভাইরাস প্রতিরোধে নিয়ম মেনে মাস্ক ব্যবহার করুন। আতঙ্কিত না হয়ে বরং সচেতন থাকুন। ভিজিট করুন <a href=\"//corona.gov.bd\" target=\"_blank\" style=\"color: blue;\" title=\"corona.gov.bd\">corona.gov.bd</a>\r\n</marquee>', NULL, NULL, 'lvwidget/February2021/1612178250.jpg', 'https://www.youtube.com/watch?v=v1R-CB3e-pw', 'lvw-coron-banner', 'No', NULL, NULL, 'Yes', 1, 1, '2021-01-31 05:16:04', '2021-01-31 14:11:49', NULL),
